import React, { useState } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';


function App() {
  const [loginForm, setLoginForm] = useState({ email: '', password: '' });
  const [token, setToken] = useState('');
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [loginMessage, setLoginMessage] = useState('');
  const [contactForm, setContactForm] = useState({ name: '', email: '' });
  const [contactMessage, setContactMessage] = useState('');

  const handleLoginChange = (e) => {
    setLoginForm({ ...loginForm, [e.target.name]: e.target.value });
  };

  const handleContactChange = (e) => {
    setContactForm({ ...contactForm, [e.target.name]: e.target.value });
  };

  const handleLoginSubmit = async (e) => {
    e.preventDefault();
    setLoginMessage('');

    try {
      const response = await axios.post('http://localhost:8000/api/login', {
        email: loginForm.email,
        password: loginForm.password,
      });

      setToken(response.data.access_token);
      setIsAuthenticated(true);
      setLoginMessage('Login successful!');
    } catch (err) {
      console.error('Login error:', err);
      setLoginMessage(err.response?.data?.message || 'Login failed. Check credentials.');
    }
  };

  const handleContactSubmit = async (e) => {
    e.preventDefault();
    setContactMessage('');

    try {
      const response = await axios.post(
        'http://localhost:8000/api/contacts',
        contactForm,
        {
          headers: {
            Authorization: `Bearer ${token}`,
            'Content-Type': 'application/json',
            Accept: 'application/json',
          },
        }
      );

      setContactMessage(response.data.message || 'Contact saved!');
      setContactForm({ name: '', email: '' });
    } catch (err) {
      console.error('Contact form error:', err);

      if (err.response?.data?.errors) {
        setContactMessage(Object.values(err.response.data.errors).flat().join(' '));
      } else {
        setContactMessage(err.response?.data?.message || 'Error submitting form.');
      }
    }
  };

  return (
    <div className="container mt-5">
      <div className="card shadow-sm p-4">
        {!isAuthenticated ? (
          <>
            <h2 className="mb-4 text-primary">Login</h2>
            <form onSubmit={handleLoginSubmit}>
              <div className="mb-3">
                <label className="form-label">Email:</label>
                <input
                  type="email"
                  name="email"
                  value={loginForm.email}
                  onChange={handleLoginChange}
                  className="form-control"
                  required
                />
              </div>
              <div className="mb-3">
                <label className="form-label">Password:</label>
                <input
                  type="password"
                  name="password"
                  value={loginForm.password}
                  onChange={handleLoginChange}
                  className="form-control"
                  required
                />
              </div>
              <button type="submit" className="btn btn-primary w-100">Login</button>
            </form>
            {loginMessage && <div className="alert alert-info mt-3">{loginMessage}</div>}
          </>
        ) : (
          <>
            <h2 className="mb-4 text-success">Contact Form</h2>
            <form onSubmit={handleContactSubmit}>
              <div className="mb-3">
                <label className="form-label">Name:</label>
                <input
                  type="text"
                  name="name"
                  value={contactForm.name}
                  onChange={handleContactChange}
                  className="form-control"
                  required
                />
              </div>
              <div className="mb-3">
                <label className="form-label">Email:</label>
                <input
                  type="email"
                  name="email"
                  value={contactForm.email}
                  onChange={handleContactChange}
                  className="form-control"
                  required
                />
              </div>
              <button type="submit" className="btn btn-success w-100">Submit</button>
            </form>
            {contactMessage && <div className="alert alert-info mt-3">{contactMessage}</div>}
          </>
        )}
      </div>
    </div>
  );
}

export default App;
